import { Fragment } from "react";
import { Route, useParams } from "react-router";
import Comments from "../components/comments/Comments";

const NewQuotes = () => {
  return (
    <Fragment>
      <h1>New Quotes</h1>
      <p>{params.quotesId}</p>
      <Route paths={`/quotes/${params.quotesId}/comments`}>
        <Comments />
      </Route>
    </Fragment>
  );
};

export default NewQuotes;
